import { Post } from "../Post/Post";
import "./Blogs.css";
import { useState, useEffect } from "react";

export const Blogs = () => {
  const [blogs, setBlogs] = useState([]);
  const getPost = async () => {
    const result = await fetch("http://localhost:5002/api/posts/allposts");
    setBlogs(result);
  };

  useEffect(async () => {
    getPost();
  }, []);
  return <div className="Blogs"></div>;
};
